import React from 'react';
import Header from './Header';
import Greeting from './Greeting';
import EntriesList from './EntriesList'
import {BrowserRouter as Router} from 'react-router-dom'

class Core extends React.Component {
  render(){
    return (
    <div className="App">
        <Header />
        <Router>
            <Greeting />
            <EntriesList />
        </Router>
    </div>
    );
  }
}

export default Core
